import React from "react";

const Userlist = ({users}) =>{
    return (
        <table className="table">
            <thead>
                <tr>
                    <th>Nombre</th>
                    <th>Apellido</th>
                    <th>Telefono</th>
                    <th>Correo</th>
                </tr>
            </thead>
            <tbody>
                {users.map(users => (
                    <tr key = {users.id}>
                        <th>{nombre}</th>
                        <th>Apellido</th>
                        <th>Telefono</th>
                        <th>Correo</th>
                    </tr>
                ))}
            </tbody>
        </table>
    );
}

export default Userlist;
